import React from 'react'
import Head from 'next/head'

const Home: React.FC = () => {
  return (
    <div >
      <Head>
        <title>PrimeNext - NextJS</title>
      </Head>

      <h1 style={{ color: "#e6e6e6", textAlign: "center" }}>Range IP - Primefox</h1>
      <input type="submit" value="" style={{ flex: 1 }} />
    </div>
  )
}

export default Home;
